INSERT INTO `tqk_article` (`id`, `cate_id`, `title`, `author`, `info`, `hits`, `ordid`, `add_time`, `last_time`, `status`, `seo_title`, `seo_keys`, `seo_desc`, `tuisong`, `pic`) VALUES
(14, 1, '加厚毛绒地板袜, 在家不穿拖鞋到处走, 也不怕冻脚啦', '毛线袜', '<div style="color: rgb(51, 51, 51); font-family: ;" class="contentbox" font-size:14px;white-space:normal;?="">\r\n<div style="text-align:justify;line-height:30px;overflow:hidden;padding-top:15px;padding-right:15px;padding-left:15px;font-size:17px;" class="article-content">\r\n	<p style="line-height:27px;font-size:18px;margin-top:0px;margin-right:auto;margin-bottom:12px !important;margin-left:auto;max-width:100%;background-color:#FFFFFF;" class="isc11">\r\n		随着社会的发展，越来越多人家里面开始装上了木制地板，在夏天的时候，无论大人还是小孩子，都喜欢在地板上面做游戏、打牌或者是跟着光盘一起做瑜伽，真是不亦乐乎；然而到了冬天，地板就显得有点凉了，这时候一双加厚毛绒地板袜就显得非常十分重要了！\r\n	</p>\r\n	<p style="background:#FFFFFF;line-height:27px;font-size:18px;margin-top:0px;margin-bottom:12px !important;max-width:100%;" class="imgbox isc12">\r\n		<img style="margin:0px auto !important;width:431px !important;height:324px !important;float:none !important;display:block;word-wrap:break-word !important;max-width:100%;opacity:1;-webkit-tap-highlight-color:transparent;" class="image lazy isc13 image-loaded" src="http://image.uc.cn/o/wemedia/s/2016/1c69de8f04371c446084c9807b85da46x431x324x19.jpeg;,3,jpegx;3,700x.jpg" heavypress="http://image.uc.cn/o/wemedia/s/2016/1c69de8f04371c446084c9807b85da46x431x324x19.jpeg;,3,jpegx;3,700x.jpg" data-size="18724" data-format="JPEG" data-height="324" data-width="431" data-infoed="1" uploaded="1" data-original="https://p3a.bytecdn.cn/large/12f6001a014688f5b6e3?imageView2/2/w/431/h/324" /> \r\n	</p>\r\n	<p style="line-height:27px;font-size:18px;margin-top:0px;margin-right:auto;margin-bottom:12px !important;margin-left:auto;max-width:100%;background-color:#FFFFFF;" class="isc11">\r\n		毕竟长时间在地板上玩耍肯定会威胁到自身的健康，中国自古有“寒从脚起”的说法，聪明的人们，居然发明了一种特别柔软的地板袜，既能够保证我们的健康，还能够让我们倍感温暖。\r\n	</p>\r\n	<p style="background:#FFFFFF;line-height:27px;font-size:18px;margin-top:0px;margin-bottom:12px !important;max-width:100%;" class="imgbox isc12">\r\n		<img style="margin:0px auto !important;width:500px !important;height:353px !important;float:none !important;display:block;word-wrap:break-word !important;max-width:100%;-webkit-tap-highlight-color:transparent;" class="image lazy isc14" src="http://image.uc.cn/o/wemedia/s/2016/b631b2c84d9d43d0d986a44983a6e5ffx500x353x34.jpeg;,3,jpegx;3,700x.jpg" heavypress="http://image.uc.cn/o/wemedia/s/2016/b631b2c84d9d43d0d986a44983a6e5ffx500x353x34.jpeg;,3,jpegx;3,700x.jpg" data-size="33893" data-format="JPEG" data-height="353" data-width="500" data-infoed="1" uploaded="1" data-original="https://p3a.bytecdn.cn/large/12f800167b0f55ad94d8?imageView2/2/w/500/h/353" /> \r\n	</p>\r\n	<p style="line-height:27px;font-size:18px;margin-top:0px;margin-right:auto;margin-bottom:12px !important;margin-left:auto;max-width:100%;background-color:#FFFFFF;" class="isc11">\r\n		地板袜不论是在寒冷的冬天还是炎热的夏天，地毯袜都非常得实用。地板袜并且不会变的特别的脏，而且在刚刚擦完了地板之后，脚上穿着地板袜，就皆有不用担心自己辛辛苦苦打扫干净的地板在变脏，也能够确保地板上面的水不会沾到脚底上，这样一来就间接地确保了自身的健康。\r\n	</p>\r\n	<p style="background:#FFFFFF;line-height:27px;font-size:18px;margin-top:0px;margin-bottom:12px !important;max-width:100%;" class="imgbox isc12">\r\n		<img style="margin:0px auto !important;width:640px !important;height:405px !important;float:none !important;display:block;word-wrap:break-word !important;max-width:100%;-webkit-tap-highlight-color:transparent;" class="image lazy isc15" src="http://image.uc.cn/o/wemedia/s/2016/3b42d496afa326cb9d40a10e33d4bccax640x405x59.jpeg;,3,jpegx;3,700x.jpg" heavypress="http://image.uc.cn/o/wemedia/s/2016/3b42d496afa326cb9d40a10e33d4bccax640x405x59.jpeg;,3,jpegx;3,700x.jpg" data-size="59980" data-format="JPEG" data-height="405" data-width="640" data-infoed="1" uploaded="1" data-original="https://p3a.bytecdn.cn/large/12f6001a032be229cc33?imageView2/2/w/640/h/405" /> \r\n	</p>\r\n	<p style="line-height:27px;font-size:18px;margin-top:0px;margin-right:auto;margin-bottom:12px !important;margin-left:auto;max-width:100%;background-color:#FFFFFF;" class="isc11">\r\n		而在寒冬的冬天，一双加厚的毛绒地板袜真是百分百的实用必须，不仅也有效的避免了在室内穿鞋，以免地板上出现了细小的划痕，影响地板；更可以充当着清洁地板的角色，如果出现了一点小小的污点，只要轻轻地用脚擦一下，就不会有什么影响了，可谓冬季必备啦！\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<br />\r\n	</p>\r\n	<p style="line-height:27px;font-size:18px;margin-top:0px;margin-right:auto;margin-bottom:12px !important;margin-left:auto;max-width:100%;background-color:#FFFFFF;" class="isc11">\r\n		非常可爱的一双毛茸茸地板袜,软绵绵的，温暖包裹着脚部，再也不怕脚冷了！看着心情就会变很好，唤醒少女心，晚上回家换上一双可爱的毛圈袜窝在沙发里看电视，听音乐，世界都美好了哇。\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<br />\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18">款式做工精细，两种毛线一起MIX出来的感觉超级好，软绵绵的手感又暖又软，丝绒线针织，超级萌哇，很适合圣诞节送礼，或者平时在家穿的。还有亲子款，可以和宝贝穿一样的袜子哦。</span> \r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<br />\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18">毛线针织外表，内里羊羔绒家居袜，内部独特加厚羊羔绒，非常厚实保暖，底部还设计有防滑胶点，袜口有带大球的松紧，小动物图案萌翻了，既美观又实用哇。</span> \r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<br />\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18">外面是毛线针织，翻绒的袜子里面都是加绒的，绒和翻出来的是一样的，保暖妥妥的。立体卡通图案，还有圣诞节专属图案，圣诞老人和驯鹿萌化了啊，并且所有的袜子底部都有防滑点，超级实用！</span> \r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<br />\r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18">软绵绵毛线双层设计，上脚舒服保暖，脚底是防滑硅胶粒，可以肆无忌惮的行走。瑜伽运动、秋冬居家睡眠都少不了它。图案萌萌哒有木有！做工设计细腻，超级推荐哦。</span> \r\n	</p>\r\n	<p style="margin:0px auto;max-width:100%;">\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18">柔软的地板袜，一定会让你爱不释手的，让你每一天都踩在“温暖”的地板上，享受地板袜带来的“温暖”生活，不为了自己家人的健康而担心，也不用恼火别人将自己刚刚擦好的地板又弄得脏兮兮哦。</span> \r\n	</p>\r\n	<div>\r\n		<span style="line-height:27px;font-size:18px;word-wrap:break-word !important;max-width:100%;background-color:#FFFFFF;" class="isc18"><br />\r\n</span> \r\n	</div>\r\n	<div style="margin:0px auto;max-width:100%;" class="weixin">\r\n	</div>\r\n</div>\r\n	</div>\r\n<div style="padding: 0px 15px; color: rgb(187, 187, 187); font-family: ; font-size: 13px; margin-top: 25px; margin-bottom: 40px; position: relative;" class="articleinfo" white-space:normal;?="">\r\n</div>', 0, 255, 1482381598, 0, 1, '', '', '', 1, '/static/images/nopic.jpg'),
(15, 1, '交警最爱查这5种车, 尤其是第四个, 九成的司机都在用', '汽车用品', '<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	开车的人都遇到过路上遇上过交警的情况，但是你注意过，那些车交警最喜欢查吗？也许是你的车品，也许是你的车灯都能让交警警觉起来，要查你哦~那么我们就来看看，交警最爱车查的5种车，那你就要小心了，只要被交警看到了，罚款扣分肯定是少不了的。\r\n</p>\r\n<p class="imgbox isc12" style="max-width:100%;margin-top:0px;font-size:18px;line-height:27px;white-space:normal;background:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	<img class="image lazy isc13 image-loaded" data-original="https://p3a.bytecdn.cn/large/12f40018d8a32e01e936?imageView2/2/w/640/h/429" src="http://image.uc.cn/s/wemedia/s/2016/8494a04852ca6b50ced1857cc48a7a8fx640x429x36.jpeg" uploaded="1" data-infoed="1" data-width="640" data-height="429" data-format="JPEG" data-size="36698" _src="http://image.uc.cn/s/wemedia/s/2016/8494a04852ca6b50ced1857cc48a7a8fx640x429x36.jpeg" heavypress="http://image.uc.cn/o/wemedia/s/2016/8494a04852ca6b50ced1857cc48a7a8fx640x429x36.jpeg;,3,jpegx;3,700x.jpg" style="border-style:none;max-width:100%;display:block;opacity:1;word-wrap:break-word !important;margin:0px auto !important;width:640px !important;height:429px !important;float:none !important;-webkit-tap-highlight-color:transparent !important;background:none !important;" />\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	1、查酒驾：副驾驶有妹纸\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	这个是真事，每次晚上查酒驾的时候，交警蜀黍特别喜欢拦下副驾驶有妹纸的车。朋友说因为这么晚了，带个妹纸一定是喝酒喝饱归来，所以酒驾的几率很大。不信？不信你试试。\r\n</p>\r\n<p class="imgbox isc12" style="max-width:100%;margin-top:0px;font-size:18px;line-height:27px;white-space:normal;background:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	<img class="image lazy isc14" data-original="https://p3a.bytecdn.cn/large/12f40018fa3b0fc34103?imageView2/2/w/640/h/433" src="http://image.uc.cn/s/wemedia/s/2016/43e92aac6803cef2b3beb552bcc2697fx640x433x25.jpeg" uploaded="1" data-infoed="1" data-width="640" data-height="433" data-format="JPEG" data-size="24702" _src="http://image.uc.cn/s/wemedia/s/2016/43e92aac6803cef2b3beb552bcc2697fx640x433x25.jpeg" heavypress="http://image.uc.cn/o/wemedia/s/2016/43e92aac6803cef2b3beb552bcc2697fx640x433x25.jpeg;,3,jpegx;3,700x.jpg" style="border-style:none;max-width:100%;display:block;word-wrap:break-word !important;margin:0px auto !important;width:640px !important;height:433px !important;float:none !important;-webkit-tap-highlight-color:transparent !important;" />\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	2、换“大灯”车型\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	关于还在用卤素灯或许氙气灯的小伙伴，想增强光源的穿透间隔和亮度，于是就会去加装灯泡和透镜。这种流氓的做法，也是不被允许，且勿玩火自焚。\r\n</p>\r\n<p class="imgbox isc12" style="max-width:100%;margin-top:0px;font-size:18px;line-height:27px;white-space:normal;background:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	<img class="image lazy isc15" data-original="https://p3a.bytecdn.cn/large/12f6001916008d9c9a34?imageView2/2/w/640/h/468" src="http://image.uc.cn/s/wemedia/s/2016/0d205044bcb0360a285dfa89c4a51968x640x468x30.jpeg" uploaded="1" data-infoed="1" data-width="640" data-height="468" data-format="JPEG" data-size="30610" _src="http://image.uc.cn/s/wemedia/s/2016/0d205044bcb0360a285dfa89c4a51968x640x468x30.jpeg" heavypress="http://image.uc.cn/o/wemedia/s/2016/0d205044bcb0360a285dfa89c4a51968x640x468x30.jpeg;,3,jpegx;3,700x.jpg" style="border-style:none;max-width:100%;display:block;word-wrap:break-word !important;margin:0px auto !important;width:640px !important;height:468px !important;float:none !important;-webkit-tap-highlight-color:transparent !important;" />\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	3、改装“排气”车型\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	关于一些爱好的年轻人，为了回头率、把妹、炫酷等常常会挑选去改装排气，一脚地板油下去，声浪飘出十里开外。一起，这么高调的做法，最简单导致交警叔叔们的留意，不逮你逮谁了？\r\n</p>\r\n<p class="imgbox isc12" style="max-width:100%;margin-top:0px;font-size:18px;line-height:27px;white-space:normal;background:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	<img class="image lazy isc16" data-original="https://p3a.bytecdn.cn/large/12f50015f8e187e34453?imageView2/2/w/640/h/469" src="http://image.uc.cn/s/wemedia/s/2016/f54608affa8631f2c567b38c4a686553x640x469x41.jpeg" uploaded="1" data-infoed="1" data-width="640" data-height="469" data-format="JPEG" data-size="41001" _src="http://image.uc.cn/s/wemedia/s/2016/f54608affa8631f2c567b38c4a686553x640x469x41.jpeg" heavypress="http://image.uc.cn/o/wemedia/s/2016/f54608affa8631f2c567b38c4a686553x640x469x41.jpeg;,3,jpegx;3,700x.jpg" style="border-style:none;max-width:100%;display:block;word-wrap:break-word !important;margin:0px auto !important;width:640px !important;height:469px !important;float:none !important;-webkit-tap-highlight-color:transparent !important;" />\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	4、毛绒的方向盘套\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	一般装上这种套的都是女司机，女司机都是想把自己的爱车打扮的漂漂亮亮的，但实际上这些东西都只是中看不中用的，没有一点实用性，而且很容易使得自己在开车的时候发生各种意外，而且在被交警看到的话，也是需要扣分罚款的。\r\n</p>\r\n<p class="imgbox isc12" style="max-width:100%;margin-top:0px;font-size:18px;line-height:27px;white-space:normal;background:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	<img class="image lazy isc13" data-original="https://p3a.bytecdn.cn/large/12f400191ca4cf2068c0?imageView2/2/w/640/h/429" src="http://image.uc.cn/s/wemedia/s/2016/195e4371d262766dcb1a9f4f780821ddx640x429x28.jpeg" uploaded="1" data-infoed="1" data-width="640" data-height="429" data-format="JPEG" data-size="28300" _src="http://image.uc.cn/s/wemedia/s/2016/195e4371d262766dcb1a9f4f780821ddx640x429x28.jpeg" heavypress="http://image.uc.cn/o/wemedia/s/2016/195e4371d262766dcb1a9f4f780821ddx640x429x28.jpeg;,3,jpegx;3,700x.jpg" style="border-style:none;max-width:100%;display:block;word-wrap:break-word !important;margin:0px auto !important;width:640px !important;height:429px !important;float:none !important;-webkit-tap-highlight-color:transparent !important;" />\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	5、电子狗\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	虽说电子狗是个好东西，小巧玲珑很方便，并且还很实用，在有摄像头的路段，它都会提醒你注意遵守交通规则，这样就使得很多司机都喜欢安转电子狗，但是现在却有很多交警都会以使用电子狗违法的原因，对你进行罚款和扣分。\r\n</p>\r\n<p class="isc11" style="max-width:100%;margin-top:0px;margin-right:auto;margin-left:auto;font-size:18px;line-height:27px;white-space:normal;background-color:#FFFFFF;color:#333333;font-family:&quot;margin-bottom:12px !important;">\r\n	这上面5种车，车主朋友一定要相当的注意，那么说了这些后，下面这3款就非常值得车主入手，它们才是真正能给车主带来帮助和安全的车载用品。\r\n</p>\r\n<p style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	\r\n</p>\r\n<p class="" style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	<span class="isc18" style="max-width:100%;font-size:18px;line-height:27px;text-align:start;word-wrap:break-word !important;">气温开始急速下降了，冬天的感觉越来越近了，据说北方已经下雪了，前档结霜和结冰的日子越来越近了，玻璃水要换成防冻的了。防冻玻璃水是一种全天候车窗清洗液，含有防冻、清洁组份，冬季可防冻，并能直接溶解冰霜，可快速去除挡风玻璃上的灰尘污垢。</span>\r\n</p>\r\n<p style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	\r\n</p>\r\n<p class="" style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	<span class="isc18" style="max-width:100%;font-size:18px;line-height:27px;text-align:start;word-wrap:break-word !important;">在一些配置较低的车型上，往往都没有座椅加热这一配置，皮质的汽车座椅很是冷，那么就来这款汽车加热垫吧~有防滑颗粒，避免垫子与座椅打滑，不会与座椅气囊有冲突，让你舒适有安全哦~</span>\r\n</p>\r\n<p style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	\r\n</p>\r\n<p class="" style="max-width:100%;margin:0px auto;color:#333333;font-family:&quot;font-size:17px;text-align:justify;white-space:normal;background-color:#FFFFFF;">\r\n	<span class="isc18" style="max-width:100%;font-size:18px;line-height:27px;text-align:start;word-wrap:break-word !important;">冬季里开车时，由于很少打开窗子通风，导致车内外温差较大，从而使风挡玻璃上布满雾气，很可能影响驾驶员视线。因此在冬天里，车主可以在风挡玻璃上喷涂一些专用的防雾剂，在行车过程中获得最好的视线。使用防雾剂，可以在玻璃上形成一层透明的保护膜，能有效防止水汽在玻璃上凝结形成雾层。这要就很好的避免了雾气所带来的问题。　</span>\r\n</p>', 0, 255, 1482385671, 0, 1, '', '', '', 1, '/static/images/nopic.jpg');
